// src/components/DealForm.tsx
import React, { useState, useEffect } from 'react';
import { Deal } from '../../types/crm/Deal';
import { Contact } from '../../types/crm/Contact';
import { ContactService } from '../../services/contactService';
import styles from '../../styles/crm/dealform.module.css';

interface DealFormProps {
  deal: Deal;
  onSave: (deal: Deal) => void;
  onCancel: () => void;
  orgId: string;
}

const DealForm: React.FC<DealFormProps> = ({ deal, onSave, onCancel, orgId }) => {
  const [formData, setFormData] = useState<Deal>(deal);
  const [contacts, setContacts] = useState<Contact[]>([]);

  useEffect(() => {
    setFormData(deal);
  }, [deal]);

  useEffect(() => {
    // Fetch contacts for the organization when the form mounts
    const fetchContacts = async () => {
      const fetchedContacts = await ContactService.getAllContacts(orgId);
      setContacts(fetchedContacts);
    };
    fetchContacts();
  }, [orgId]);

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleContactChange = (contactId: string) => {
    setFormData(prev => ({ ...prev, contact_id: contactId }));
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    onSave(formData);
  };

  return (
    <div className={styles.popupOverlay}>
      <div className={styles.popup}>
        <form onSubmit={handleSubmit} className={styles.form}>
          <h3>{deal.id ? 'Edit Deal' : 'Add Deal'}</h3>
          <label>
            Deal Name:
            <input type="text" name="name" value={formData.name} onChange={handleChange} />
          </label>
          <label>
            Stage:
            <select name="stage" value={formData.stage} onChange={handleChange}>
              <option value="new">New</option>
              <option value="discovery">Discovery</option>
              <option value="proposal">Proposal</option>
              <option value="negotiation">Negotiation</option>
              <option value="won">Won</option>
              <option value="lost">Lost</option>
            </select>
          </label>
          <label>
            Deal Value:
            <input type="number" name="dealValue" value={formData.dealValue} onChange={handleChange} />
          </label>
          <label>
            Expected Close Date:
            <input type="date" name="expectedCloseDate" value={formData.expectedCloseDate} onChange={handleChange} />
          </label>
          <label>
            Close Probability (%):
            <input type="number" name="closeProbability" value={formData.closeProbability} onChange={handleChange} />
          </label>
          <label>
            Contact:
            <select name="contact_id" value={formData.contact_id || ""} onChange={(e) => handleContactChange(e.target.value)}>
              <option value="">Select Contact</option>
              {contacts.map(contact => (
                <option key={contact._id} value={contact._id}>
                  {contact.contact_name}
                </option>
              ))}
            </select>
          </label>
          <div className={styles.buttonGroup}>
            <button type="submit">Save</button>
            <button type="button" onClick={onCancel}>Cancel</button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default DealForm;
